import React from 'react';
import Tables from './tables';

let surveys= ['survey1', 'survey2', 'survey3', 'survey4', 'survey5', 'survey6']

class Survey extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            surveys: surveys
        }
    }

    render(){

        const {surveys} = this.state;
        return(
            <div className="columns">
                <div className="column is-centered has-text-centered">
                    Survey List
                        <div class="table-container">
                            <table class="table is-bordered is-striped is-narrow is-hoverable is-fullwidth">
                                <tbody>
                                    {surveys.map( (survey) => {
                                        console.log(survey)
                                        return(
                                            // <Tables/>
                                            <tr>
                                            <td> <strong> Survey 1</strong></td>
                                            <td className="has-text-centered">
                                                <button className="button is-success is-outlined">Assign</button> &nbsp;
                                                <button className="button is-danger is-outlined">Remove</button>
                                            </td>
                                        </tr>
                                        )
                                    })
                                }
                            </tbody>
                            </table>
                        </div>
                    </div>

                <div className="column is-centered has-text-centered">
                    Assigned Surveys
                    <div class="table-container">
                            <table class="table is-bordered is-striped is-narrow is-hoverable is-fullwidth">
                                <tbody>
                                    <Tables/>
                            </tbody>
                            </table>
                        </div>
                </div>

            </div>
        )
    }
}

export default Survey
